create table district_code
(
    id     bigint auto_increment
        primary key,
    code   bigint(12)   not null comment '区划代码',
    name   varchar(128) not null comment '名称',
    level  tinyint      not null comment '级别（1-5，省市区镇村）',
    p_code bigint(12)   null comment '父级区划代码'
)
    comment '行政区划代码表';

create index district_code_index
    on district_code (code, name, level, p_code);

